@jacobandco showing their phenomenal watchmaking skills with the Twin Turbo Furious in Rose Gold, a true Grand Complication Masterpiece hand assembled movement with 832 components.

The Twin Turbo Furious takes the exceptionally cool and uniquely complex Twin Turbo concept and takes it to the next level by adding a Monopusher Chronograph and Pit Board time difference calculator to the original's twin triple-axis tourbillon and decimal minute repeater.

The Twin Turbo Furious is yet another groundbreaking @jacobandco creation, one that is like no other to have ever existed in fine watchmaking before.
